import React from "react";
import Details_page from "./Details_page"
import './index.css';

function Card(props){
    return (
        <>
            <div className="cards">
            <div className="card">
            <img src={Props.card_img}   alt="random img"  className="card_img"/>
            <div className="card_info">
            <span className="title">{props.title}</span>
            <h1 className="heading">{props.headname}</h1>
            <a href={props.links}  target="_blank">
                <button className="btn">WATCH NOW</button>
            </a>
            </div>
            </div>
            </div>
        </>
    )
}

export default Card;
